(()=>{return(a,e)=>{const n=new Map([["useDefaultPlayerLayout",`デフォルト・プレーヤー・レイアウトを設定する. できるだけ、適切なページに設定（例えば、番組の放送ページに番組プレーヤーのレイアウトを設定する）、そうでない場合は効果がない可能性があります.\n- 旧版: 伝統的なレイアウト\n- 新版: 動画ページに黙認の新版レイアウト\n注意: 伝統的なレイアウトでは、多くのスクリプト機能が適用されない.`],["defaultPlayerLayout",`動画プレーヤーのレイアウトを設定する.`],["defaultBangumiLayout",`番組プレーヤーのレイアウトを設定する.`],["useDefaultPlayerMode",`デフォルト・プレーヤー・モードが使用するかどうかを制御する、 例えば<span>常规</span>、<span>宽屏</span>、 <span>网页全屏</span>か<span>全屏</span>.`],["defaultPlayerMode",`デフォルト・プレーヤー・モードが設定する.`],["applyPlayerModeOnPlay",`再生時にモードを適用するかどうか、「いいえ」を選択すると、再生が開始されていないときに適用されます.`],["autoLightOff",`初回放送時には、自動的に消灯モードに入り、再生終了後に自動的に点灯します.`],["useDefaultVideoQuality",`動画を開くときに指定された画質を自動的に選択する. 映像の最高画質が選択された画質より低ければ、映像の最高画質を使用する.`],["defaultVideoQuality",`自動的に選択された映像画質を設定する.`],["useDefaultDanmakuSettings",`デフォルトで弾幕を開くかどうかを設定する.そして、「防挡字幕」と「智能防挡弹幕」を覚えておくかどうかを設定できる.`],["enableDanmaku",`弾幕がデフォルトで開くかどうかを制御する.`],["rememberDanmakuSettings",`シールド設定を覚えるかどうかを制御する、「防挡字幕」と「智能防挡弹幕」を含まれています.これらの設定を動画制御欄で変更すると、すべでの動画にデフォルトでこれらの設定が使用されます.`],["expandDanmakuList",`新版レイアウトでは、他のおすすめ動画が表示されるようにデフォルトで弾幕リストが折りたたまれています.この機能を有効にすると、動画が読み込まれるたびに弾幕リストが自動的に展開されます.`],["expandDescription",`長すぎる動画概要欄はデフォルトで折りたたまれています、この機能を有効にすると完全な動画概要欄が強制的に展開されます.`],["autoContinue",`動画再生時に視聴履歴が検出されると(<span>前回の见た...</span>情報)、自動的に対応する時間に再生される.`],["autoPlay",`動画ページに入ると、自動的に動画の再生が開始されます.`],["skipChargeList",`エンディングの「充电鸣谢」を自動スキップ.`],["framePlayback",`プレーヤーの時間に右側に2つのボタンが追加されました.動画の時間を細かく調整するために使用される. キーボードショートカットに対応します<kbd>Shift</kbd>+<kbd>←</kbd>/<kbd>→</kbd>. (伝統的なレイアウトでキーボードショートカットのみ使用でき、ボタンは表示されません)`],["playerFocus",`動画/番組の放送ページに入る時、プレーヤーに自動的に移動する.`],["playerFocusOffset",`移動時の垂直オフセット、単位はピクセル(px).`],["outerWatchlater",`動画放送ページの<span>稍后再看</span>を外に移動します.`],["customStyleColor",`頂欄(スタイルの調整が有効な場合）とダークテーマのテーマ色で埋める、カラープレビューサークルをクリックして、设定の16種類のテーマカラーにできるの、右側のテキストボックスに任意の有効な16進数のカラー値を直接入力することもできます.(<span>#rrggbb</span>或<span>#rgb</span>).`],["useNewStyle",`<span>主要</span>会改变顶栏的样式, 并有一些其他地方的界面微调:\n- 为播放器增加主题色投影\n- 可控制顶栏对横幅的透明度\n- 使播放器按钮垂直对齐\n- 使部分搜索栏的提示文字的颜色更清晰\n- 隐藏播放页面的"返回旧版"侧栏\n- 修复直播间一些文字初始状态不正确\n- 窄屏幕下强制保留弹幕发送栏`],["blurBackgroundOpacity",`设置顶栏对横幅的透明度(0~1), 数值越高顶栏越淡, 当横幅关闭时此选项无效.`],["customNavbar",`启用自定义顶栏, 替代原版的顶栏, 仅对主站生效, 不影响直播/相簿/会员购等.`],["customNavbarFill",`テーマ色で頂欄を埋めるかどうか.`],["allNavbarFill",`テーマ色で他の頂欄を埋めるかどうか, 「生放送」、「アルバム」、「会员购」などが含まれています.`],["customNavbarShadow",`是否为顶栏添加一层阴影效果.`],["customNavbarCompact",`是否为顶栏使用更紧凑的布局, 紧凑布局将使用更小的间距, 以及在视频标题过长时用...省略后面的部分.`],["customNavbarBlur",`是否在顶部横幅存在时, 使用背景模糊效果.`],["useDarkStyle",`ダークテーマでは、ページの明るい部分が暗い色に変わり、夜間の視聴に最適な表示になります.そして多くのテーマカラーを適用します.ぜひお試しください.`],["darkSchedule",`ダークテーマを使用して计画タイムを設定する.この期間を開始または終了すると、ダークテーマは自動的にオンまたはオフになり、終了時刻は開始時刻より短く、翌日と見なされます.例えば<span>18:00</span>から<span>6:00</span>夜の18：00から翌日の6：00までを表しています.`],["darkScheduleStart",`計画期間の開始時刻を設定する.`],["darkScheduleEnd",`計画期間の終了時刻を設定する.`],["compactLayout",`设置首页是否使用紧凑布局, 视频的间距会减小并削去圆角, 分区栏的图标会使用高清重制版. 目前仅支持首页, 其他分区的样式后续会添加.`],["useCommentStyle",`- 删除热评头像下方的关注按钮\n- 删除用户的等级标识\n- 删除发送源信息(<span>来自安卓客户端</span>这种)\n- 发送时间移动到右上角\n- 位图图标全部换用矢量图标, 高分屏不会模糊\n注: 关注和等级可以通过鼠标停留在头像上, 在弹出的资料卡小窗中查看.`],["simplifyLiveroom",`- 隐藏姥爷图标\n- 隐藏粉丝勋章\n- 隐藏活动头衔\n- 隐藏用户等级\n- 隐藏舰长图标\n- 隐藏全区广播\n- 隐藏欢迎信息 (xxx姥爷进入直播间)\n- 隐藏抽奖提示 (开通舰长, 小飞船抽奖等)\n- 禁用直播间皮肤\n各項目は、非表示にするかどうかを<span>附加功能</span>の中で個別に選択することができる.`],["preserveRank",`控制是否在搜索框左侧显示排行榜图标.`],["blurVideoControl",`模糊视频控制栏背景, 原版的阴影效果将无效.`],["playerShadow",`プレーヤーにテーマカラーの投影の追加する.`],["narrowDanmaku",`在网页全屏时, 即使宽度过小也强制保留弹幕发送栏, 注意这可能导致右侧的功能按钮挤出边界.`],["customControlBackground",`给视频控制栏附上半透明的黑色, 代替原来的阴影.`],["customControlBackgroundOpacity",`设置控制栏着色的黑色不透明度(0~1), 数值越大黑色越浓.`],["harunaScale",`根据屏幕DPI缩放直播看板娘的大小以提高像素的清晰度.`],["removeLiveWatermark",`生放送時、隅の透かしを削除する.`],["removeVideoTopMask",`マウスが通過したら、動画の右上隅にあるタイトル層を削除します.`],["hideOldEntry",`放送ページの右側<span>返回旧版</span>を隠す.`],["removeAds",`ビリビリのさまざまな広告を削除する.ホームページのプロモーションモジュール、モバイルアプリのおすすめ、動画ページの右側にある広告などが含まれます.`],["watchLaterRedirect",`将稍后再看的链接重定向为普通播放网址, 以使用新版播放页面.`],["favoritesRedirect",`将个人空间收藏夹里的视频重定向为直链, 而不是收藏夹播单链接.`],["hideTopSearch",`検索欄の推薦語を<span>搜索</span>に置き換える.`],["fullTweetsTitle",`頂欄の情報プレビューページでは、常に完全なタイトルが展開されます.`],["fullPageTitle",`動画選集一覧では、常に完全なタイトルが展開されます.`],["showDeadVideoTitle",`在个人空间中, 为已失效视频恢复标题和封面.`],["useBiliplusRedirect",`将失效视频重定向到BiliPlus.`],["biliplusRedirect",`在视频/番剧/空间中, 附加功能<span>"转到BiliPlus"</span>, 点击可以转到BiliPlus上对应的页面.`],["imageResolution",`根据屏幕DPI请求更高分辨率的图片, 例如DPI缩放200%则请求2倍的分辨率, 加载时间也会相应变长一些.`],["oldTweets",`将新版动态的链接换为旧版动态, 同时可在附加功能中在新旧动态间切换.`],["i18n",`インタフェースの一般的なテキストの翻訳を提供する.`],["i18nLanguage",`翻訳言語`],["touchNavBar",`删除顶栏右侧的一级链接(从<span>大会员</span>到<span>历史</span>), 以方便触屏设备快速预览信息. 被删除的链接可从各预览中的<span>查看更多</span>进入.`],["comboLike",`为素质三连(长按点赞)启用触摸支持.`],["touchVideoPlayer",`增大控制栏的按钮间距, 使触摸操作更准确. 并为播放器启用触摸支持:\n- 左右滑动可调整进度\n- 上下滑动可调整音量\n- 进度调整可在左上角和右上角取消\n- 在不同位置滑动, 可以使用3档不同的灵敏度.`],["touchVideoPlayerAnimation",`タッチ調整のヒントボックスにアニメーションの表示と非表示のどうかを決定します.このアニメーションはフレームがドロップされる可能性があります.`],["touchVideoPlayerDoubleTapControl",`操作方法を変更する.クリック:制御欄を表示/非表示, ダブルクリック放送/一時停止.`],["toast",`ウェブページの左下隅に表示スクリプトからのメッセージ、例えば更新通知の送信、エラーメッセージなどです.`],["toastInternalError",`オープンしたら、エラーメッセージは詳細な技術的エラー情報とスタック追跡を表示します.これは通常問題発生の原因を正確に確定するために使用されます.だから、問題を報告する時にこれらの情報はとても役に立ちます.`],["useCache",`スクリプトの読み込み速度を上げるためにキャッシュを使う.`]]);return{export:{toolTips:n}}}})();